    {
      "@type": "DiscussionForumPosting",
      "mainEntityOfPage": "https://community.babycenter.com/post/a78413154/cant-hold-off-any-longergonna-have-to-do-insulin-advice",
      "url": "https://community.babycenter.com/post/a78413154/cant-hold-off-any-longergonna-have-to-do-insulin-advice",
      "author": {
        "@type": "Person",
        "name": "BeatlesChick86"
      },
      "headline": "Can't Hold Off Any Longer...Gonna Have to Do Insulin.  Advice?",
      "datePublished": "2024-05-14T16:05:02.000Z",
      "dateModified": "2024-05-14T16:05:02.000Z",
      "text": "Welp, I'm pretty sure I have no choice but to give in to using insulin.  Currently 22w6d, and up until the last 7 days all my numbers were looking pretty good with diet and exercise (fasting under 95 and all post-meal numbers under 135).  However, over the last 7 days my fasting numbers (via fingerstick) have been creeping up: 100, 105, 112, 104, 108, 116, 115 and now 124 today.\n\nI also noticed that during this time, my nighttime trends on my continuous monitor have changed.  Doesn't matter what time I go to bed, as soon as I'm sleeping, my glucose numbers begin to rise.  They've even reached 180 on the monitor (however confirmed to be 143 per fingerstick--difference between monitor and fingerstick is a totally different story).\n\nMy doc prescribed 10 units of Lantus before bed, since post-meal numbers aren't an issue.  However, she understood my fear that I'd have a reaction or drop too low overnight so she's allowing me to dose 2x days in the AM, 2x days at noon, and then the rest of the time before bed.  This way I can see how my body reacts and I can be awake to act accordingly 'just in case'.  \n\nMy questions for those of you who are more seasoned at this:\n\n--Have you used Lantus before/did you find it effective?\n--Do you have any advice/tips/tricks when starting insulin?\n--Suggestions on the best place to inject (belly, arm, leg, etc.)?\n--When doing the 'before bed' injection: how far before you crawl into bed do you inject? (doc just told me 'before bed' which seems pretty non-descript)\n--Anything else to know?\n\nAny help for this newbie would be greatly appreciated--especially since I'm worried I'll have an allergic reaction or go into a diabetic coma at night!",
      "comment": [
        {
          "@type": "Comment",
          "text": "I am on Lantus too.  I am at 10 units before bed.  I was also nervous about it at first but I have had no issues with it bottoming me out.  I take it, have a snack, and then am in bed within the hour.  I was injecting in my belly but that was getting hard and it was causing me to bruise.  I actually started injecting in the lower outside of my butt cheek and haven’t had any issues with it not working as well as my belly and it hurts less there for me.  I’m not sure that’s a “recommended” location but someone I know who is diabetic told me it’s one they have used with success before.",
          "author": {
            "@type": "Person",
            "name": "adrienne0915"
          },
          "datePublished": "2024-05-17T00:40:07.000Z",
          "dateModified": "2024-05-17T00:40:07.000Z",
          "interactionStatistic": {
            "@type": "InteractionCounter",
            "userInteractionCount": 0,
            "interactionType": {
              "@type": "LikeAction"
            }
          }
        },
        {
          "@type": "Comment",
          "text": "Thanks for commenting!  I injected in the morning the last two days (per my doctors instructions) and didn't notice much difference--if anything my daytime blood sugars are now higher, which is bit concerning actually.  I definitely didn't bottom out, phew!  However I find that because my boobs are so big (42I) I'm having a hard time seeing my belly when I inject---haha!  So I think I'll switch to the back of my arm this next time and see how it goes.  Although, good pointer on injecting on the outside of the butt...I'll keep that in mind as I discover the best place for me.",
          "author": {
            "@type": "Person",
            "name": "BeatlesChick86"
          },
          "datePublished": "2024-05-17T15:05:37.000Z",
          "dateModified": "2024-05-17T15:05:37.000Z",
          "interactionStatistic": {
            "@type": "InteractionCounter",
            "userInteractionCount": 0,
            "interactionType": {
              "@type": "LikeAction"
            }
          }
        },
        {
          "@type": "Comment",
          "text": "Let me know how the back of the arm goes.  I’m kind of a baby about needles and was afraid it would hurt more.  Idk why, maybe just because I don’t feel like there’s much far there.",
          "author": {
            "@type": "Person",
            "name": "adrienne0915"
          },
